import Cards from "./Cards";
import "./CardList.css";

class CardList extends Component {
  render() {
    const { data } = this.props.map(id => id);
    return (
      <div className="main">
        {console.log(data.cards[0].id)}
        <Cards />
        <Cards />
        <Cards />
      </div>
    );
  }
}

export default CardList;
